//Contract based on https://docs.openzeppelin.com/contracts/3.x/erc721
// SPDX-License-Identifier: MIT
pragma solidity ^0.7.3;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

//currency odi will be accpted.

contract MyNFT2 is ERC721 {//Ownable // any one can mint this nft
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

    constructor() ERC721("MyNFT2", "NFT") {}

    //do not include owner on this function as this would lock this for customers who want to buy

    function mintToken(address to, uint256 tokenId, string memory uri) public virtual payable {
      
      require(msg.value >= 1, "Not enough BNB sent; check price!"); 
      
      _mint(to, tokenId);//transfer selected nft to buyer
      _setTokenURI(tokenId, uri);//set nft uri to particular endpoint
    }
    
    // non-coding alternative would be to simply list your newly minted NFT on OpenSea or
    // another NFT auction website which would allow you to place a price on it. 
    //OpenSea's UI layer running on top of the NFT allows you to place prices, accept bids,
    // or have other more complex auction methods and handles all the logic for you
    //addres//tokenURI : it is metadata such as name, desc, image, and others

    function mintNFT(address recipient, string memory tokenURI) public returns (uint256)
    {
        _tokenIds.increment();

        uint256 newItemId = _tokenIds.current();
        _mint(recipient, newItemId);
        _setTokenURI(newItemId, tokenURI);

        return newItemId;//id of freshly minted nft
    }
}
